  true,\n\t\"url\": null,\n\t\"notes\": \"The reprocessed OMI/Aura Level-2 cloud data
  product OMCLDO2 is now available from the NASA GoddardEarth Sciences Data and Information
  Services Center (GES DISC) for the public access.It is the second release of Version
  003 and was reprocessed late 2011.nn(The shortname for this Level-2 OMI cloud product
  is OMCLDO2) nnOMI provides two cloud products based on two different algorithms,
  thenRotational Raman Scattering method and O2-O2 absorption method using the DOASntechnique.
  This level-2 global cloud product at the pixel resolution (13x24 km2nat nadir) is
  based on the spectral fitting of O2-O2 absorption band at 477 nmnusing DOAS technique.
  This product contains cloud pressure, cloud fraction,nslant column O2-O2; O3, Ring
  coefficients, uncertainties in derivednparameters, terrain and geolocation information,
  solar and satellite viewingnangles, and quality flags.nnThe shortname for this Level-2
  OMI cloud product is OMCLDO2  and the leadnscientist for this product is Dr. Pepijn
  Veefkind.nnOMCLDO2  product  files are stored in Hierarchical Data Format (HDF-EOS5).
  nEach file contains data from the day lit portion of an orbit (~53 minutes) andnis
  roughly 15.096 MB in size. There are approx 14 orbits per day thus the totalndata
  volume is approximately 200 GB/day.nnA Readme document containing brief algorithm
  description and  known datanquality related issues and  file spec are  provided
  by the OMCLDO2 Algorithmnlead (see  http://disc.sci.gsfc.nasa.gov/Aura/secondary/documentation/OMI_DUG.pdf
  ).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
